-- ----------------------------
--  Table structure for `os_stock_entry`
-- ----------------------------
DROP TABLE IF EXISTS `os_stock_entry`;
CREATE TABLE `os_stock_entry` (
  `stock_id` int(11) NOT NULL AUTO_INCREMENT,
  `os_product_id` int(11) NOT NULL,
  `real_cost` decimal(10,2) DEFAULT NULL,
  `stock_entry_num` int(11) DEFAULT NULL,
  `stock_despatch_num` int(11) DEFAULT '0',
  `stock_present_num` int(11) DEFAULT NULL,
  `buy_shop` varchar(255) DEFAULT NULL,
  `buyer` varchar(255) DEFAULT NULL,
  `purchase_time` timestamp NULL DEFAULT NULL,
  `entry_time` timestamp NULL DEFAULT NULL,
  `update_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`stock_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='商品入库';

-- ----------------------------
--  Table structure for `os_transaction`
-- ----------------------------
DROP TABLE IF EXISTS `os_transaction`;
CREATE TABLE `os_transaction` (
  `trans_id` int(11) NOT NULL AUTO_INCREMENT,
  `stock_id` int(11) DEFAULT NULL,
  `trans_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `order_id` int(11) DEFAULT NULL,
  `despatch_num` int(11) DEFAULT NULL,
  PRIMARY KEY (`trans_id`),
  KEY `order_id` (`order_id`),
  KEY `stock_id` (`stock_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='商品出库';

-- ----------------------------
--  Table structure for `ot_product`
-- ----------------------------
DROP TABLE IF EXISTS `ot_product`;
CREATE TABLE `ot_product` (
  `product_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '产品ID',
  `product_name` varchar(200) NOT NULL,
  `product_chinese_name` varchar(200) DEFAULT NULL,
  `barcode` int(11) DEFAULT NULL,
  `category_id` int(11) DEFAULT NULL,
  `brand_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`product_id`),
  KEY `fk_brand` (`brand_id`) USING BTREE,
  KEY `fk_category` (`category_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
--  Table structure for `privileges`
